import React from "react";
import "./app.css";
import Cards from "./page/Cards";
import { BrowserRouter, Route, Routes } from "react-router-dom";

const App = () => {
  return;
  <BrowserRouter>
    <Route>
      <Routes path="/" elements={<Cards />} />
    </Route>
  </BrowserRouter>;
};

export default App;
